  console.log(user.characters)

  if (user.characters.length > 1) {
    const userCharacterCards = user.characters.map(character => <UserCharacterCard key={character.id}/>)
  }


  return (
    <>
    {userCharacterCards}
    </>
  )
}

export default Account
